package main

import (
  "fmt"
  "io"
  "net/http"
  "time"
) // import

func httpAnswer(w http.ResponseWriter, r *http.Request) {
  
  fmt.Println(time.Now().Format("2006-01-02 15:04:05 +0000 UTC"), "Answering HTTP Request")

  /*
  Set the Headers BEFORE calling WriteHeader
  */
  w.Header().Set("X-XSS-Protection",          "1; mode=block")
  w.Header().Set("X-Content-Type-Options",    "nosniff")
  w.Header().Set("Content-Security-Policy",   "default-src 'self' data: http: https:; style-src 'self' 'unsafe-inline'; script-src 'self' 'unsafe-inline' 'unsafe-eval' *;")
  w.Header().Set("X-Frame-Options",           "SAMEORIGIN")
  w.Header().Set("X-Robots-Tag",              "noindex, noarchive, nosnippet")
  w.Header().Set("Strict-Transport-Security", "max-age=631138519")
  w.Header().Set("X-Cloud-Kittens",           "warrior")
  //w.Header().Set("X-Cloud-Kittens",           "cataclysm")

  w.WriteHeader(http.StatusOK)

  io.WriteString(w, "<!DOCTYPE html>")
  io.WriteString(w, "<html><head><title>Cloud Kittens</title>")
  io.WriteString(w, "<style type='text/css'>")
  io.WriteString(w, "* { padding:0px; margin:0px; text-align:center; font-family:sans-serif; background-color:#000000; color:#ffa600; }")
  io.WriteString(w, "</style>")
  io.WriteString(w, "</head>")
  io.WriteString(w, "<body>")
  // warrior
  io.WriteString(w, "<img src='data:image/png;base64, ' />")
  io.WriteString(w, "<h1><span style='color:cyan;'>Hero Warrior Kitten</span> is keeping everything safe</h1>" + "\n")
  // cataclysm
  //io.WriteString(w, "<img src='data:image/png;base64, ' />")
  //io.WriteString(w, "<h1><span style='color:red;'>Cataclysm</span> reigns supreme!</h1>" + "\n")

  io.WriteString(w, "</body></html>")


} // func httpAnswer



func main() {

  http.DefaultClient.Timeout = 10 * time.Second

  fmt.Println(time.Now().Format("2006-01-02 15:04:05 +0000 UTC") + 
              " Starting up http listener on port " + 
              "8000" + 
              " ..." )
  http.HandleFunc("/", httpAnswer)
  http.ListenAndServe(":" + "8000", nil)

} // func main




